import Paper from "@material-ui/core/Paper";

function Question({ question,index, getQuestionId, id }){

    const q = this.props.getQuestionId(this.props.id);
    return(

        <Paper
            key={index}
        >
            <h3>{question.category}</h3>
            <p>{}</p>
        </Paper>
    )
}


export default Question;
